import React, { useEffect, useState } from "react";
import home from "../assets/home.jpeg";
import apto from "../assets/Edificio.jpeg";

function CardsComponent() {
    const [places, serPlaces] = useState([]);
    const [selectedPlace, setSelectedPlace] = useState(null);

    let url = "https://gist.githubusercontent.com/josejbocanegra/0067d2b28b009140fee423cfc84e40e6/raw/6e6b11160fbcacb56621b6422684d615dc3a0d33/spaces.json";



    console.log("urlll", url);
    useEffect(() => {
      fetch(url)
        .then((resp) => resp.json())
        .then((jsonData) => {
          console.log("JSON Data", jsonData);
          serPlaces(jsonData);
        })
        .catch((error) => console.error(error));
    }, []);

     return (



        <Container>
        <Row >



         {places.map((element) => InfoCartas(element))}

         </Row>
         </Container>

      );




}


function InfoCartas(place)
{

  const [selectedPlace, setSelectedPlace] = useState(null);

    return(
      <Col className="col-mb-2" key={`space ${place.name}`} md="2">
        <Card onClick={() => {
                  setSelectedPlace(place);
                  console.log("selectedSpace", selectedPlace);
                }}
              >
        <div className="card">
          <Image
        className="card-img-top"
        src={place.type === "house" ? home : apto}        alt="Card image cap"
        fluid
      />
        <div className="card-body">
            <h5 className="card-title">{place.name} </h5>
            <p className="card-text">{place.address}</p>
        </div>
    </div>
    </Card>
    </Col>
    );


}

export default CardsComponent;
